INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (21, 'Set several centuries in the future, the abandoned Alita is found in the scrapyard of Iron City by Ido, a compassionate cyber-doctor who takes the unconscious cyborg Alita to his clinic. When Alita awakens, she has no memory of who she is, nor does she have any recognition of the world she finds herself in. As Alita learns to navigate her new life and the treacherous streets of Iron City, Ido tries to shield her from her mysterious past.', 'http://t2.gstatic.com/images?q=tbn:ANd9GcSxo7Naxu0tjuSEZ9_faYL--aWjx8V5TKr4q2YeenYKXXik-T5P', 2019, 'Alita: Battle Angel', 'https://www.youtube.com/watch?v=w7pYhpJaJW8', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (25, 'After gunning down a member of the High Table -- the shadowy international assassin''s guild -- legendary hit man John Wick finds himself stripped of the organization''s protective services. Now stuck with a $14 million bounty on his head, Wick must fight his way through the streets of New York as he becomes the target of the world''s most ruthless killers.', 'http://t3.gstatic.com/images?q=tbn:ANd9GcTaABFJr_eVRUhtaPnKfihePqqNsJjcGvZ62OgxCv6wjXn-XgGC', 2019, 'John Wick: Chapter 3: Parabellum', 'https://www.youtube.com/watch?v=M7XM597XO94', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (28, 'In April 1945, the Allies are making their final push in the European theater. A battle-hardened Army sergeant named Don ''Wardaddy'' Collier (Brad Pitt), leading a Sherman tank and a five-man crew, undertakes a deadly mission behind enemy lines. Hopelessly outnumbered, outgunned and saddled with an inexperienced soldier (Logan Lerman) in their midst, Wardaddy and his men face overwhelming odds as they move to strike at the heart of Nazi Germany.', 'http://www.gstatic.com/tv/thumb/v22vodart/10731391/p10731391_v_v8_ab.jpg', 2014, 'Fury', 'https://www.youtube.com/watch?v=q94n3eWOWXM', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (38, 'Adrift in space with no food or water, Tony Stark sends a message to Pepper Potts as his oxygen supply starts to dwindle. Meanwhile, the remaining Avengers -- Thor, Black Widow, Captain America and Bruce Banner -- must figure out a way to bring back their vanquished allies for an epic showdown with Thanos -- the evil demigod who decimated the planet and the universe.', 'http://t2.gstatic.com/images?q=tbn:ANd9GcQA_-tL18_rj9zEcjN6n41NEaJm-kRNF9UeOtvksZ4z_OW6jRA9', 2019, 'Avengers: Endgame', 'https://www.youtube.com/watch?v=TcMBFSGVi1c', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (39, 'Iron Man, Thor, the Hulk and the rest of the Avengers unite to battle their most powerful enemy yet -- the evil Thanos. On a mission to collect all six Infinity Stones, Thanos plans to use the artifacts to inflict his twisted will on reality. The fate of the planet and existence itself has never been more uncertain as everything the Avengers have fought for has led up to this moment.', 'http://t0.gstatic.com/images?q=tbn:ANd9GcRmE2vwxy5KaCu7cRuYYdgNdQKddux5OYgGwsPo0kqP_xzLnsDV', 2018, 'Avengers: Infinity War', 'https://www.youtube.com/watch?v=6ZfuNTqbHE8', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (40, 'A billionaire industrialist and genius inventor, Tony Stark (Robert Downey Jr.), is conducting weapons tests overseas, but terrorists kidnap him to force him to build a devastating weapon. Instead, he builds an armored suit and upends his captors. Returning to America, Stark refines the suit and uses it to combat crime and terrorism.', 'http://www.movienewsletters.net/photos/277216R1.jpg', 2008, 'Iron Man', 'https://www.youtube.com/watch?v=byQpcN78UjQ', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (41, 'Thrilled by his experience with the Avengers, young Peter Parker returns home to live with his Aunt May. Under the watchful eye of mentor Tony Stark, Parker starts to embrace his newfound identity as Spider-Man. He also tries to return to his normal daily routine -- distracted by thoughts of proving himself to be more than just a friendly neighborhood superhero. Peter must soon put his powers to the test when the evil Vulture emerges to threaten everything that he holds dear.', 'http://www.movienewsletters.net/photos/252069R1.jpg', 2017, 'Spider-Man: Homecoming', 'https://www.youtube.com/watch?v=U0D3AOldjMU', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (47, 'Brash space adventurer Peter Quill (Chris Pratt) finds himself the quarry of relentless bounty hunters after he steals an orb coveted by Ronan, a powerful villain. To evade Ronan, Quill is forced into an uneasy truce with four disparate misfits: gun-toting Rocket Raccoon, treelike-humanoid Groot, enigmatic Gamora, and vengeance-driven Drax the Destroyer. But when he discovers the orb''s true power and the cosmic threat it poses, Quill must rally his ragtag group to save the universe.', 'https://contentserver.com.au/assets/516361_p10108283_p_v8_ak.jpg', 2014, 'Guardians of the Galaxy', 'https://www.youtube.com/watch?v=d96cjJhvlMA', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (49, 'Peter Quill and his fellow Guardians are hired by a powerful alien race, the Sovereign, to protect their precious batteries from invaders. When it is discovered that Rocket has stolen the items they were sent to guard, the Sovereign dispatch their armada to search for vengeance. As the Guardians try to escape, the mystery of Peter''s parentage is revealed.', 'http://www.impawards.com/2017/posters/guardians_of_the_galaxy_vol_two_ver4.jpg', 2017, 'Guardians of the Galaxy Vol. 2', 'https://www.youtube.com/watch?v=2cv2ueYnKjg', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (50, 'When former U.N. investigator Gerry Lane (Brad Pitt) and his family get stuck in urban gridlock, he senses that it''s no ordinary traffic jam. His suspicions are confirmed when, suddenly, the city erupts into chaos. A lethal virus, spread through a single bite, is turning healthy people into something vicious, unthinking and feral. As the pandemic threatens to consume humanity, Gerry leads a worldwide search to find the source of the infection and, with luck, a way to halt its spread.', 'http://www.gstatic.com/tv/thumb/v22vodart/9087912/p9087912_v_v8_af.jpg', 2013, 'World War Z', 'https://www.youtube.com/watch?v=Md6Dvxdr0AQ', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (56, 'Capt. Jack Sparrow (Johnny Depp) arrives at Port Royal in the Caribbean without a ship or crew. His timing is inopportune, however, because later that evening the town is besieged by a pirate ship. The pirates kidnap the governor''s daughter, Elizabeth (Keira Knightley), who''s in possession of a valuable coin that is linked to a curse that has transformed the pirates into the undead. A gallant blacksmith (Orlando Bloom) in love with Elizabeth allies with Sparrow in pursuit of the pirates.', 'http://www.gstatic.com/tv/thumb/v22vodart/32093/p32093_v_v8_aa.jpg', 2003, 'Pirates of the Caribbean: The Curse of the Black Pearl', 'https://www.youtube.com/watch?v=0Z1XpfbuZOA', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (57, 'When ghostly pirate Davy Jones (Bill Nighy) comes to collect a blood debt, Capt. Jack Sparrow (Johnny Depp) must find a way to avoid his fate lest his soul be damned for all time. Nevertheless, the wily ghost manages to interrupt the wedding plans of Jack''s friends Will Turner (Orlando Bloom) and Elizabeth Swann (Keira Knightley).', 'http://www.gstatic.com/tv/thumb/v22vodart/159655/p159655_v_v8_aa.jpg', 2006, 'Pirates of the Caribbean: Dead Man''s Chest', 'https://www.youtube.com/watch?v=iPKbf7H8qC8', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (58, 'Will Turner (Orlando Bloom) and Elizabeth Swann (Keira Knightley) join forces with Capt. Barbossa (Geoffrey Rush) to free Jack Sparrow (Johnny Depp) from Davy Jones'' locker. Meanwhile, the crew of the Flying Dutchman ghost ship wreaks havoc on the Seven Seas. The friends must navigate dangerous waters to confront Chinese pirate Sao Feng (Chow Yun-Fat) and, ultimately, they must choose sides in a battle wherein the pirate life hangs in the balance.', 'http://www.gstatic.com/tv/thumb/v22vodart/164907/p164907_v_v8_ag.jpg', 2007, 'Pirates of the Caribbean: At World''s End', 'https://www.youtube.com/watch?v=HKSZtp_OGHY', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (59, 'The checkered past of Capt. Jack Sparrow (Johnny Depp) catches up to him when he encounters Angelica (Pen√©lope Cruz), a beautiful pirate that Jack once loved then left. Angelica forces him to accompany her to the Queen Anne''s Revenge, the ship of the notorious Blackbeard (Ian McShane). Accompanied by a zombie crew, the trio sets sail to find the legendary Fountain of Youth. However, Jack''s rival, Barbossa (Geoffrey Rush), also seeks the fountain, as does a ship from Spain.', 'http://www.gstatic.com/tv/thumb/v22vodart/7989366/p7989366_v_v8_ab.jpg', 2011, 'Pirates of the Caribbean: On Stranger Tides', 'https://www.youtube.com/watch?v=t5AqJww06bw', null, null);
INSERT INTO ratethemoviedb.movie (id, description, image_url, release_year, title, trailer_url, director_id, user_id) VALUES (60, 'Thrust into an all-new adventure, a down-on-his-luck Capt. Jack Sparrow feels the winds of ill-fortune blowing even more strongly when deadly ghost sailors led by his old nemesis, the evil Capt. Salazar, escape from the Devil''s Triangle. Jack''s only hope of survival lies in seeking out the legendary Trident of Poseidon, but to find it, he must forge an uneasy alliance with a brilliant and beautiful astronomer and a headstrong young man in the British navy.', 'http://www.gstatic.com/tv/thumb/v22vodart/12009531/p12009531_v_v8_ab.jpg', 2017, 'Pirates of the Caribbean: Dead Men Tell No Tales', 'https://www.youtube.com/watch?v=Hgeu5rhoxxY', null, null);